import { useSelector } from "react-redux";

import Post from "./Post/Post";

const Posts = () => {
  const posts = useSelector(state => state.posts);

  return (
    <div>
      {posts.map(post => (
        <div key={post._id}>
          <Post post={post} />
        </div>
      ))}
    </div>
  );
};

console.log(posts);

export default Posts;
